      <header>
        <div class="text-center my-5 fixed">
          <h1 class="m-0 text-primary bg-white d-block rounded shadow p-3">
            Santi Empleo | Aplicación
          </h1>
          <p class="slogan text-white mt-5">
            ¡¡Buscas trabajo, tenemos trabajo!!
          </p>
        </div>

      <!-- application form -->
      <div class="contact-clean mt-5">
        <form data-bss-recipient="359ca3ebcd0dc58c048b482aa622464d">
          <h3 class="text-center mb-3">Aplica</h3>
          <div class="form-group">
            <input
              class="form-control"
              type="text"
              name="nombre"
              placeholder="Nombre completo"
              required=""
              autofocus=""
            />
          </div>

          <div class="form-group">
            <input
              class="form-control"
              type="text"
              name="ciudad"
              placeholder="Ciudad"
              required=""
            />
          </div>

          <div class="form-group">
            <input
              class="form-control"
              type="text"
              name="estado"
              placeholder="Estado"
              required=""
            />
          </div>

          <div class="form-group">
            <input
              class="form-control"
              type="text"
              name="telefono"
              placeholder="Teléfono"
              required=""
            />
          </div>

          <div class="form-group">
            <input
              class="form-control"
              type="text"
              name="red-social"
              placeholder="Enlace de Facebook (facebook.com/usuario)"
            />
          </div>

          <div class="form-group">
            <textarea
              class="form-control"
              name="mensaje"
              placeholder="Mensaje"
              rows="10"
            ></textarea>
          </div>
          <div class="form-group">
            <button class="btn btn-primary" type="submit">send</button>
          </div>
        </form>
      </div>

        <div class="text-center my-5 fixed">
